import React, { useState } from "react";
import styled from 'styled-components';
import ModalLogin from "./ModalLogin";

const Ingresar = () => {

    const [estadoModal, cambiarEstadoModal] = useState(true)
    return (
        <div>
            <ContenedorAnclas>
                <Ancla onClick={() => cambiarEstadoModal(estadoModal)}>Ingresar</Ancla>
            </ContenedorAnclas>

            <ModalLogin
                estado={estadoModal}
                cambiarEstado={cambiarEstadoModal}
            >
                <Contenido>
                    <h1>Ventana Modal</h1>
                    <p>Reutilizable y con opciones de personalizaci√≥n</p>
                    <button>Aceptar</button>
                </Contenido>
            </ModalLogin>
        </div>
    );
}

export default Ingresar;

const ContenedorAnclas = styled.div`
    font-family: 'Bruno Ace SC', cursive;
    padding: 3px;
    border: solid 1px black;
`;

const Ancla = styled.div`
    color: blue;
    cursor: pointer;
`;

const Contenido = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
	h1 {
		font-size: 42px;
		font-weight: 700;
		margin-bottom: 10px;
	}
	p {
		font-size: 18px;
		margin-bottom: 20px;
	}
	img {
		width: 100%;
		vertical-align: top;
		border-radius: 3px;
	}
`;
